import React from 'react';

import { NavLink } from 'react-router-dom';

import { HeaderStyle, LeftHeaderItem, RightHeaderItem } from './Header.styles';

const Header = () => {
    return (
        <HeaderStyle className='header'>
            <LeftHeaderItem>Home page</LeftHeaderItem>
            <RightHeaderItem><NavLink to="/login" style={({ isActive })}>Login</NavLink> / <NavLink>Sign up</NavLink></RightHeaderItem>
            <RightHeaderItem><NavLink>Logout</NavLink></RightHeaderItem>
        </HeaderStyle>
    )
}

export default Header;
